import axios from 'axios';
const getData = () => {
    return {
        async componentDidMount() {
            let res = await axios.get('http://localhost:8080/admin/user/allUser');
            this.setState({
                users: res.data
            })
        }
    }
}
const rootReducer = (reduxState, action) => {
    return reduxState;
}

export default rootReducer
